import axios from 'axios'

function sendResult(){
    axios.post('http://127.0.0.1:5000/user',
    {
        'name' : 'test',
        'age' : 10
    })
}

function getIdNum(){
    var result
    axios.get('http://127.0.0.1:5000/getIdNum',result)
    console.log(result)
    return 0
}
export {sendResult, getIdNum}
